import { useEffect, useState } from "react";
import axios from "axios";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  CircularProgress,
  Typography,
} from "@mui/material";

const CallLogs = () => {
  const [logs, setLogs] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios
      .get("http://localhost:8080/api/logs/today")
      .then((response) => {
        console.log("Fetched logs:", response.data); // Debug
        setLogs(response.data);
        setLoading(false);
      })
      .catch((error) => {
        console.error("Error fetching logs:", error);
        setLoading(false);
      });
  }, []);

  if (loading) {
    return (
      <div style={{ padding: "1rem", textAlign: "center" }}>
        <CircularProgress />
        <Typography>Loading call logs...</Typography>
      </div>
    );
  }

  if (logs.length === 0) {
    return (
      <div style={{ padding: "1rem" }}>
        <Typography variant="h6">No call logs available for today.</Typography>
      </div>
    );
  }

  return (
    <div style={{ padding: "1rem" }}>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Phone Number</TableCell>
              <TableCell>Call Type</TableCell>
              <TableCell>Call Time</TableCell>
              <TableCell>Duration (seconds)</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {logs.map((log, index) => (
              <TableRow key={index}>
                <TableCell>{log.phoneNumber}</TableCell>
                <TableCell>{log.callType}</TableCell>
                <TableCell>
                  {new Date(log.callTime).toLocaleString()}
                </TableCell>
                <TableCell>{log.duration}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default CallLogs;
